import React from 'react'

const RegisterSection = () => {
    return(
        <div className = "bg-home-section bg-cover filter grayscale-40 transition duration-1000 ease-in-out transform hover:filter grayscale-0 bg-center w-11/12 h-screen rounded-full -mt-5 relative">
            <div className = "absolute left-1/2 border-2 border-black rounded h-full"></div>
            <div className = "flex flex-row justify-evenly w-full absolute top-1/2">
                <button className = "text-8xl font-artistic font-extrabold mr-32 transition duration-500 ease-in-out transform hover:scale-125">Login</button>
                <button className = "text-5xl font-artistic font-extrabold ml-32 transition duration-500 ease-in-out transform hover:scale-125">Register</button>
            </div>
    </div>  
    )
}

export default RegisterSection;
